import React, { Component } from 'react';
var $  = require( 'jquery' );
$.DataTable = require('datatables.net');

class HomeOne extends Component {
  componentDidMount() {
    $(this.refs.main).dt({
       dom: '<"data-table-wrapper"t>',
       data: this.props.names,
       columns,
       ordering: false
    });
}

componentWillUnmount(){
   $('.data-table-wrapper')
   .find('table')
   .DataTable()
   .destroy(true);
}

shouldComponentUpdate() {
    return false;
}

render() {
    return (
        <div>
            <table ref="main" />
        </div>);
}
}
const columns = [
  {
      title: 'Name',
      width: 120,
      data: 'name'
  },
  {
      title: 'Nickname',
      width: 180,
      data: 'nickname'
  },
];
export default HomeOne;
